import React from "react";
import './Login.css'
import { Link } from "react-router-dom";
function Login(){
    return(
        <div className="login">
            <Link to="/">
                <img 
                    className="login_logo"
                    src="https://logos-world.net/wp-content/uploads/2020/04/Amazon-Logo.png"
                />
            </Link>
            <div className="login_container">
                <h1></h1>
            </div>
        </div>
    )
}
export default Login
